(2, 'United Nations Human Development Index (HDI)', '', '<table>\r\n	<span><tr>\r\n		<th>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b>United Nations Human Development Index (HDI)</b>&nbsp; &nbsp;&nbsp;<br></th>\r\n	</tr>\r\n	<tr>\r\n		<td>Data provider</td>\r\n		<td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b>United Nations</b>&nbsp; &nbsp;&nbsp;<br></td>\r\n	</tr>\r\n	<tr>\r\n		<td>Source</td>\r\n		<td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b>United Nations</b>&nbsp; &nbsp;&nbsp;<br></td>\r\n	</tr>\r\n	<tr>\r\n		<td>Description</td>\r\n		<td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b>Human Development Index (HDI)</b>&nbsp; &nbsp;&nbsp;<br></td>\r\n	</tr>\r\n	<tr>\r\n		<td>Time span</td>\r\n		<td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b>1980-2013</b>&nbsp; &nbsp;&nbsp;<br></td>\r\n	</tr>\r\n	<tr>\r\n		<td>Geographic coverage</td>\r\n		<td>Global by country</td>\r\n	</tr>\r\n	<tr>\r\n		<td>Link</td>\r\n		<td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b><a target="_blank" rel="nofollow" href="http://hdr.undp.org/en/content/human-development-index-hdi">http://hdr.undp.org/en/content/human-development-index-hdi</a></b>&nbsp; &nbsp;&nbsp;<br></td>\r\n	</tr>\r\n	<tr>\r\n		<td>Retrieved</td>\r\n		<td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b>07/09/2010</b>&nbsp; &nbsp;&nbsp;<br></td>\r\n	</tr>\r\n</span></table>\r\n<div>\r\n	<h3>Additional information</h3>\r\n	<p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p><b>The\r\nfrequency of the data changes from every 5 years to annual. Coverage for\r\ncountries is not complete and some countries only appear in more recent rounds\r\nof the HDI.</b></p>\r\n</div>', '2015-09-08 17:14:17', '2015-09-08 17:14:17'),
(3, 'International Institute of Applied Systems Analysis (IIASA) – Population projections (GET)', '', '<table>\r\n <span><tr>\r\n  <td>\r\n  <p><b>International Institute of Applied Systems Analysis\r\n  (IIASA) – Population projections (GET)</b></p>\r\n  </td>\r\n  <td><p>&nbsp;</p></td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Data\r\n  provider</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>International\r\n  Institute of Applied Systems Analysis (IIASA)</b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Source</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>International\r\n  Institute of Applied Systems Analysis (IIASA)</b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Description</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>Highest\r\n  level of education achieved for those aged 15+, and population aged 0-14. The\r\n  projections are based on the Global Education Trends scenario.</b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Time\r\n  span</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>1970-2050</b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Geographic\r\n  coverage</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>Global\r\n  by country</b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Link</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>http://www.oeaw.ac.at/vid/dataexplorer/</b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td>\r\n  <p><b>Retrieved</b></p>\r\n  </td>\r\n  <td>\r\n  <p><b>07/09/2010</b></p>\r\n  </td>\r\n </tr>\r\n</span></table>\r\n\r\n<p><b>Additional\r\ninformation</b></p>\r\n\r\n<p><b>Data\r\nfrequency is every 5 years. Projections are made using UN data from the year\r\n2000 and projecting forwards and backwards using different models. The data\r\nuploaded here is for the Global Education Trends (GET) scenario which assumes a\r\ncontinuation of current trends into the future.</b></p>\r\n\r\n<div>\r\n</div>', '2015-09-08 17:19:28', '2015-09-08 17:19:28'),
